ControlPropertyState.AutoRuleBindingString:
If(varReassignPopupVisible, 
    Filter(
        shiftplanner_userroles,
        
        // Only get those with the right role
        Role.shiftplanner_role = varBookingToReassign.'Team Position'.Role.shiftplanner_role

        // Exclude the unavailable
        And Not (
            Resource.User in ShowColumns(
                AddColumns(
                    Filter(shiftplanner_useravailabilities, StartDate <=varBookingToReassign.Date ),
                    UserGuid,
                    User.User
                ), 
                UserGuid
            )
        )

        // Exclude the booked    
        And Not( 
            Resource.User in
            ShowColumns(
                AddColumns(
                    Filter(
                        shiftplanner_shiftbookings,
                        Date = varSelectedUserDay.ShiftDate
                    ),
                    UserId,
                    Resource.User                    
                ),
                UserId
            )
        )
    )
)
